          <img src={logoIndex} className="logoIndex" />
          <ul className="navbar-nav mr-auto">
            <li class="nav-item active">
              <a class="nav-link" href="#">Inicio </a>
            </li>

          </ul>

        </nav>
      </div>
    </div>
  );
}

export default App;
